<!DOCTYPE html>
<html lang="es">
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1">
        <title>Carta Compromiso</title>
        <style>
            body {
                font-family: Arial, Helvetica, sans-serif;
                font-size: 14px;
            }
            th, td {
                padding: 5px;
            }
            td, th, table {
                border: 1px solid black;
            }
            table {
                width: 100%;
                border-collapse: collapse;
            }
            .text-justify {
                text-align: justify;
            }
            .text-end {
                text-align: right;
            }
        </style>
    </head>
    <body>
        <p style="text-align: center">
            <img alt="Encabezado Unibe" src="data:image/png;base64,">
        </p>
        <br>
        <p>
            Señor/a<br>
            <b>DIRECTOR DE LA CARRERA DE {{$estudianteData['carrera']}}</b>
            <br>
            <b>UNIB.E</b><br>
            Presente.-
        </p>
        <br>
        <p class="text-justify">
            Yo, {{$estudianteData['nombre_estudiante']}}, estudiante, portador de la cédula de ciudadanía /
            identidad No. {{$estudianteData['cedula_estudiante']}}, de la Carrera de {{$estudianteData['carrera']}},
            en la que actualmente me estoy matriculando en el semestre Nº {{$estudianteData['semestre']}}, por medio del
            presente, dejo constancia escrita de mi compromiso a cumplir de manera irrestricta con las
            disposiciones contenidas en el protocolo de bioseguridad de la institución
            {{$estudianteData['empresa']}}, durante el desarrollo de mis prácticas pre profesionales /
            actividades de vinculación con la sociedad. 
        </p>
        <p class="text-justify">
            En caso de incumplir con una o varias disposiciones contenidas en el referido protocolo, deslindo a
            la institución {{$estudianteData['empresa']}} y a la Universidad Iberoamericana del Ecuador de
            cualquier responsabilidad en caso de registrarse cualquier complicación o contagio producto de
            ese imcumplimiento.
        </p>
        <br>
        <p class="text-end">
            Quito, D.M, {{$estudianteData['fecha_texto']}}
        </p>
        <br><br><br><br><br><br>
        <p>
            Srta./Sr {{$estudianteData['nombre_estudiante']}}<br>
            ESTUDIANTE DE LA CARRERA DE: {{$estudianteData['carrera']}}<br>
            CC: {{$estudianteData['cedula_estudiante']}}
        </p>
    </body>
</html>
